import React from 'react';
import {
  IonList, IonItem, IonLabel, IonInput, IonToggle, IonRadio, IonCheckbox, IonItemSliding,
  IonItemOption, IonItemOptions, IonContent, IonPage
} from '@ionic/react';

const Tab2 = () => (
  <IonPage>
    <IonContent >
      {/*-- List of Text Items --*/}
      <IonList>
        <ion-item>
          <ion-avatar slot="start">
            <img src="./avatar-han.png"></img>
          </ion-avatar>
          <ion-label>
            <h2><strong>Han</strong></h2>
            <h3>9112</h3>
            <p>I've got enough on my plate as it is, and I...</p>
          </ion-label>
        </ion-item>
      </IonList>



      {/*-- List of Sliding Items --*/}

    </IonContent>
  </IonPage>
);
export default Tab2;
